import { findByLabelText } from "@testing-library/react";
import { NavLink } from "react-router-dom";

const Stylednavbar = () => {
  return (
    <div className=" fixed flex flex-col bg-[#151515] h-full w-24">
      <nav className="flex flex-col gap-5 font-mono text-[#964F4CFF] h-11 text-lg px-5 py-1">
        <NavLink
          to="/"
          className={({ isActive }) =>
            isActive ? "underline text-[#2E5266FF]" : "text-[#6E8898FF]"
          }
        >
          Home
        </NavLink>
        <NavLink
          to="about"
          className={({ isActive }) =>
            isActive ? "underline text-[#2E5266FF]" : "text-[#6E8898FF]"
          }
        >
          About Me
        </NavLink>
        <NavLink
          to="projects"
          className={({ isActive }) =>
            isActive ? "underline text-[#2E5266FF]" : "text-[#6E8898FF]"
          }
        >
          Projects
        </NavLink>
        <NavLink
          to="contact"
          className={({ isActive }) =>
            isActive ? "underline text-[#2E5266FF]" : "text-[#6E8898FF]"
          }
        >
          Contact
        </NavLink>
      </nav>
    </div>
  );
};

export default Stylednavbar;
